import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Button,
  Row,
  Container,
  FormGroup,
  Input,
  Form,
  Card,
  CardHeader
} from "reactstrap";
import { Typography } from "@material-ui/core";
import "../App.css";
import Header from "../header/header";

class Profile extends Component {
  render() {
    return (
      <div>
        <Header />
        <Container>
          <br></br>
          <br></br>
          <Form inline>
            <FormGroup style={{ width: "95%" }}>
              <Input
                name="search"
                id="exampleEmail"
                placeholder="Cari..."
                style={{ width: "100%" }}
              />
            </FormGroup>
            <Button>Cari</Button>
          </Form>
          <br></br>
          <br></br>
          <h1 style={{ textAlign: "left" }}>Category</h1>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <h1>Today</h1>

          <h1>Upcoming Event</h1>
        </Container>
      </div>
    );
  }
}

export default Profile;
